import Features from './src/components/Features/Features'; // Импортируем компонент Features
import Contact from './src/components/Contact/Contact'; // Импортируем компонент Contact

function App() {
  return (
    <div className="App">
      {/* Вставляем компонент Hero */}
      <Hero />

      {/* Вставляем компонент Features */}
      <Features />

      {/* Вставляем компонент Contact */}
      <Contact />
    </div>
  );
}

export default App;
